import React, {useState} from 'react';
import './App.css'
import 'antd/dist/antd.css'
import Cadastro from './components/Cadastro';
import { Layout, Menu } from 'antd';
import {
  MenuUnfoldOutlined,
  MenuFoldOutlined,
  UserOutlined,
  VideoCameraOutlined,
  UploadOutlined,
} from '@ant-design/icons';

const { Header, Sider, Content } = Layout;

function App () {

  const [collapsed, setCollapsed] = useState(false);

  function trigger () {
    setCollapsed(true);
  }

  return (
    <Layout>
        <Sider trigger={null} collapsible collapsed={setCollapsed}>
          <div className="logo" />
          <Menu theme="dark" mode="inline" defaultSelectedKeys={['1']}>
            <Menu.Item key="1" icon={<UserOutlined />}>
              Gráficos
            </Menu.Item>
            <Menu.Item key="2" icon={<VideoCameraOutlined />}>
              Formulário Cadastro
            </Menu.Item>
            <Menu.Item key="3" icon={<UploadOutlined />}>
              Registro Geral
            </Menu.Item>
          </Menu>
        </Sider>
        <Layout className="site-layout">
          <Header className="site-layout-background" style={{ padding: 0 }}>
            {React.createElement(trigger ? MenuUnfoldOutlined : MenuFoldOutlined, {
              className: 'trigger',
              onClick: {trigger},
            })}
          </Header>
          <Content
            className="site-layout-background"
            style={{
              margin: '24px 16px',
              padding: 24,
              minHeight: 280,
            }}
          >
            <h2> Conteúdo página home e outras páginas </h2>
          </Content>
        </Layout>
      </Layout>
  )
}

export default App;
